import { BrowserRouter } from "react-router-dom";
import "./App.css";
import Main from "./views/main";
import RouterDom from "./views/Router.js";

function App() {
  return (
    <BrowserRouter>
      <Main />
      <RouterDom />
    </BrowserRouter>
  );
}

export default App;
